import { Tabs } from 'antd';
const onChange = (key) => {
  console.log(key);
};
const items = [
  {
    key: '1',
    label: `전체`,
    children: `Content of Tab Pane 1`,
  },
  {
    key: '2',
    label: `곤지암 엣지센터`,
    children: `Content of Tab Pane 2`,
  },
  {
    key: '3',
    label: `엣지센터2`,
    children: `Content of Tab Pane 3`,
  },
  {
    key: '4',
    label: `엣지센터3`,
    children: `Content of Tab Pane 3`,
  },
];
const Tabintab = () => <Tabs defaultActiveKey="1" items={items} onChange={onChange} />;
export default Tabintab;
